import BaseLayout from "../Layouts/BaseLayout";
import Tabs from "../shared/Wnioski/Tabs";

const FormsLayout = (props) => {
  return (
    <BaseLayout title={props.title}>
      <Tabs />
    </BaseLayout>
  );
};

export default FormsLayout;
